<script>
function enforceSingleOverlay() {
  // procura listas de overlays (Leaflet adiciona sub-div com classe 'leaflet-control-layers-overlays')
  var overlayList = document.querySelector('.leaflet-control-layers-overlays');
  if(!overlayList) {
    // tenta novamente em 300ms se ainda não estiver disponível
    setTimeout(enforceSingleOverlay, 300);
    return;
  }
  var inputs = overlayList.querySelectorAll('input[type="checkbox"]');
  inputs.forEach(function(input) {
    // remove handlers duplicados
    input.addEventListener('change', function() {
      if(this.checked) {
        inputs.forEach(function(other) {
          if(other !== input && other.checked) {
            // aciona clique para desligar; usar .click() aciona a lógica interna do Leaflet
            other.click();
          }
        });
      }
    });
  });
}
// aguarda a renderização do controle e executa
setTimeout(enforceSingleOverlay, 500);
</script>

            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }

        } else {

        }

        `<tr>

            <td>${handleObject(layer.feature.properties[v]).toLocaleString()}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
